        },
        {
          name: 'Seba',
          city: 'Bielsko',
          age: 13
        }  

        ])


    console.log(user)

    // console.log(id)
    return(
        <div>
            Name: {user.name}
            Age: {user.age}
            city: {user.city}
        </div>
    )
}
